import React, { Component } from 'react'

export default class App extends Component {
    constructor(props) {
      super(props)

      this.state = {
         count1 : 10,
         count2 : 0
      }
    }

  render() {

    const { count1 , count2 } = this.state

    return (
      <div>
        <button onClick = { ()=> this.setState( this.state.count1 = this.state.count1+10 )}>SetState1 : { count1 }</button>
        <button>SetState2 : { count2 }</button>

      </div>
    )
  }
}
